func ByParentCompanyField(field string, opts ...sql.OrderTermOption) OrderOption {
	return func(s *sql.Selector) {
		sqlgraph.OrderByNeighborTerms(s, newParentCompanyStep(), sql.OrderByField(field, opts...))
	}
}
